### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Signals and Systems Basics
- **Signals**: Functions that convey information about the behavior or attributes of a phenomenon.
- **Systems**: Entities that process input signals to produce output signals.
- **Types of Signals**: Continuous-time, discrete-time, periodic, aperiodic, even, odd, conjugate symmetric, conjugate asymmetric.

#### 2. Signal Operations
- **Time Shifting**: \( x(t - t_0) \)
- **Time Scaling**: \( x(at) \)
- **Reflection**: \( x(-t) \)
- **Conjugation**: \( f^*(t) \)

#### 3. Signal Symmetry
- **Even Signal**: \( f(t) = f(-t) \)
- **Odd Signal**: \( f(t) = -f(-t) \)
- **Conjugate Symmetric**: \( f(t) = f^*(-t) \)
- **Conjugate Asymmetric**: \( f(t) = -f^*(-t) \)

#### 4. Signal Energy and Power
- **Energy of a Signal**:
  \[ E = \int_{-\infty}^{\infty} |x(t)|^2 \, dt \]
- **Power of a Signal**:
  \[ P = \lim_{T \to \infty} \frac{1}{2T} \int_{-T}^{T} |x(t)|^2 \, dt \]

#### 5. Dirac Delta Function
- **Definition**: \( \delta(t) \) is zero for all \( t \neq 0 \) and infinite at \( t = 0 \), with the integral over the entire real line equal to 1.
- **Properties**:
  \[ \int_{-\infty}^{\infty} \delta(at) \, dt = \frac{1}{|a|} \]
  \[ \int_{-\infty}^{\infty} x(t)\delta(t - t_0) \, dt = x(t_0) \]

#### 6. Periodic Signals
- **Periodic Signal**: A signal \( x(t) \) is periodic if there exists a positive number \( T \) such that \( x(t + T) = x(t) \) for all \( t \).
- **Fundamental Period**: The smallest positive \( T \) for which \( x(t + T) = x(t) \).

#### 7. Signal Transformations
- **Time Reversal**: \( y(t) = x(-t) \)
- **Time Scaling**: \( y(t) = x(at) \)
- **Amplitude Scaling**: \( y(t) = A x(t) \)

### Important Equations

1. **Energy of a Signal**:
   \[ E = \int_{-\infty}^{\infty} |x(t)|^2 \, dt \]

2. **Power of a Signal**:
   \[ P = \lim_{T \to \infty} \frac{1}{2T} \int_{-T}^{T} |x(t)|^2 \, dt \]

3. **Dirac Delta Function Property**:
   \[ \int_{-\infty}^{\infty} \delta(at) \, dt = \frac{1}{|a|} \]

4. **Periodic Signal**:
   \[ x(t + T) = x(t) \]

5. **Fundamental Period of \( e^{jt} \)**:
   \[ T = 2\pi \]

